    return (
        <section>
            <Navbar />
            <div style={{ position: "relative", marginTop: '50px' }} className="addImage">
                <div
                    style={{
                        position: "absolute",
                        top: "50%",
                        left: "50%",
                        transform: "translate(-50%, -50%)"
                    }}
                    className="container text-center">
                    {/* <div className=" py-3" id="selectionPart">
                    <h1 className="text-primary">
                        Hi. What do you need to make ?
                    </h1>
                </div> */}
